import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Logo from '../components/Logo';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <header>
      <Logo />

    <h1>Groupomania</h1>


    </header>
    <App />
  </React.StrictMode>
);
